import FlexBetween from "./FlexBetween";
import { Box, Button } from "@mui/material"


const PlayButton = () => {
    
    return(
        <FlexBetween>
            <Box alignContent="center">
                <Button fontSize="50px" variant="outlined">PLAY</Button>
            </Box>
            
        </FlexBetween>
    );
}
export default PlayButton;
